import{_ as e,c as r,o as t,d as a}from"./app.91b8b69c.js";const b=JSON.parse('{"title":"Используемое программное обеспечение","description":"","frontmatter":{},"headers":[{"level":2,"title":"Для полетных контроллеров","slug":"для-полетных-контроллеров","link":"#для-полетных-контроллеров","children":[]},{"level":2,"title":"Для регуляторов","slug":"для-регуляторов","link":"#для-регуляторов","children":[]},{"level":2,"title":"Для RC приемников","slug":"для-rc-приемников","link":"#для-rc-приемников","children":[]},{"level":2,"title":"Для TBS","slug":"для-tbs","link":"#для-tbs","children":[]},{"level":2,"title":"Для аппаратуры","slug":"для-аппаратуры","link":"#для-аппаратуры","children":[]},{"level":2,"title":"Для прошивки видеосистем","slug":"для-прошивки-видеосистем","link":"#для-прошивки-видеосистем","children":[]},{"level":2,"title":"Симуляторы","slug":"симуляторы","link":"#симуляторы","children":[]},{"level":2,"title":"Для изучения логов","slug":"для-изучения-логов","link":"#для-изучения-логов","children":[]},{"level":2,"title":"Фиксеры драйверов для Windows","slug":"фиксеры-драиверов-для-windows","link":"#фиксеры-драиверов-для-windows","children":[]}],"relativePath":"community/software.md"}'),s={name:"community/software.md"},l=a(`<h1 id="используемое-программное-обеспечение" tabindex="-1">Используемое программное обеспечение <a class="header-anchor" href="#используемое-программное-обеспечение" aria-hidden="true">#</a></h1><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-palenight"><code><span class="line"><span style="color:#A6ACCD;">Для Windows файлы с расширением .EXE</span></span>
<span class="line"><span style="color:#A6ACCD;">Для Linux .rpm, .deb</span></span>
<span class="line"><span style="color:#A6ACCD;">Для Mac .dmg</span></span>
<span class="line"><span style="color:#A6ACCD;">Для Android .apk</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre></div><blockquote><p>Фразы &quot;Release Candidate (RC)&quot;, &quot;Pre-release&quot; означают следующее: это релиз-кандидат, предназначенный для тестирования, и некоторые вещи еще нуждаются в исправлении и тонкой настройке. Пожалуйста, используйте его с осторожностью и сообщайте о любых проблемах по адресу <a href="https://github.com/betaflight/betaflight-configurator/issues" target="_blank" rel="noreferrer">https://github.com/betaflight/betaflight-configurator/issues</a>. Чем новее релиз-кандидат, тем больше исправлений, но ошибки все еще могут оставаться ввиду человеческого фактора в тестировании и возможных ошибок при слиянии веток разработки(см. как работает git). Если вы не готовы к рискам, связанным с этим, рекомендуется использовать только релизы (Release). Настоятельно рекомендуется использовать соответствующие версии прошивок и конфигураторов: в INav нумерация идентична, в Betaflight для 4.3.* версии нужен конфигуратор 10.8.* или новее, для 4.4.х нужен 10.9.х, для прошивок регуляторов и приемников необходима просто последняя версия конфигуратора, обратная совместимость есть.</p></blockquote><h2 id="для-полетных-контроллеров" tabindex="-1">Для полетных контроллеров <a class="header-anchor" href="#для-полетных-контроллеров" aria-hidden="true">#</a></h2><p>Конфигуратор Betaflight Configurator (для прошивки полетного контроллера): <a href="https://github.com/betaflight/betaflight-configurator/releases" target="_blank" rel="noreferrer">https://github.com/betaflight/betaflight-configurator/releases</a></p><p>Конфигуратор INav Configurator (для прошивки полетного контроллера): <a href="https://github.com/iNavFlight/inav-configurator/releases" target="_blank" rel="noreferrer">https://github.com/iNavFlight/inav-configurator/releases</a></p><p>Конфигуратор QuickSilver (для прошивки полетного контроллера <strong>tiny whoop-а</strong>, потомок silverware): <a href="https://config.bosshobby.com/#/home" target="_blank" rel="noreferrer">https://config.bosshobby.com/#/home</a></p><p>Конфигуратор KISS ULTRA (для прошивки полетного контроллера KISS ULTRA): <a href="https://github.com/KissUltra/gui/releases" target="_blank" rel="noreferrer">https://github.com/KissUltra/gui/releases</a></p><p>Конфигуратор KISS (для прошивки полетного контроллера KISS или Fettec): <a href="https://github.com/flyduino/kiss-gui/releases" target="_blank" rel="noreferrer">https://github.com/flyduino/kiss-gui/releases</a></p><p>Конфигуратор Mission Planner (для прошивки Ardupilot (см. <a href="https://ardupilot.org/copter/docs/common-autopilots.html" target="_blank" rel="noreferrer">список поддерживаемых полетных контроллеров</a>)): <a href="https://ardupilot.org/planner/docs/mission-planner-installation.html" target="_blank" rel="noreferrer">https://ardupilot.org/planner/docs/mission-planner-installation.html</a></p><p>Конфигуратор QGroundControl (для прошивки PX4 и Ardupilot (см. <a href="https://discuss.px4.io/t/list-of-px4-supported-fc-hardware/24901" target="_blank" rel="noreferrer">список поддерживаемых полетных контроллеров</a>)): <a href="http://qgroundcontrol.com/downloads" target="_blank" rel="noreferrer">http://qgroundcontrol.com/downloads</a></p><p>Конфигуратор FlightOne FalcoX Alpha (для прошивки полетных контроллеров от FlightOne или полетников с купленной прошивкой FalcoX): <a href="https://flightone.com/download.php?version=alpha" target="_blank" rel="noreferrer">https://flightone.com/download.php?version=alpha</a></p><p>Конфигуратор EmuFlight (для прошивки полетного контроллера): <a href="https://github.com/emuflight/EmuConfigurator/releases" target="_blank" rel="noreferrer">https://github.com/emuflight/EmuConfigurator/releases</a></p><h2 id="для-регуляторов" tabindex="-1">Для регуляторов <a class="header-anchor" href="#для-регуляторов" aria-hidden="true">#</a></h2><p>Конфигуратор Bluejay Configurator (для прошивки регуляторов прошивкой BLheli_S; BlueJay, с возможностью использования rpm-фильтров) (8bit): <a href="https://esc-configurator.com" target="_blank" rel="noreferrer">https://esc-configurator.com</a> (также поддерживает экспериментальную прошивку AM32 для 32bit регуляторов)</p><p>Конфигуратор BlHeli Suite (для прошивки регуляторов) (32bit): <a href="https://github.com/bitdump/BLHeli/releases" target="_blank" rel="noreferrer">https://github.com/bitdump/BLHeli/releases</a></p><h2 id="для-rc-приемников" tabindex="-1">Для RC приемников <a class="header-anchor" href="#для-rc-приемников" aria-hidden="true">#</a></h2><p>Конфигуратор ExpressLRS (для прошивки приемников и передатчиков ELRS): <a href="https://github.com/ExpressLRS/ExpressLRS-Configurator/releases" target="_blank" rel="noreferrer">https://github.com/ExpressLRS/ExpressLRS-Configurator/releases</a></p><p>Online конфигуратор ExpressLRS: <a href="https://pkendall64.github.io/elrs-web-flasher" target="_blank" rel="noreferrer">https://pkendall64.github.io/elrs-web-flasher</a></p><h2 id="для-tbs" tabindex="-1">Для TBS <a class="header-anchor" href="#для-tbs" aria-hidden="true">#</a></h2><p>Конфигуратор Agent M (для прошивки Team BlackSheep продукции): <a href="https://www.team-blacksheep.com/agentm" target="_blank" rel="noreferrer">https://www.team-blacksheep.com/agentm</a></p><h2 id="для-аппаратуры" tabindex="-1">Для аппаратуры <a class="header-anchor" href="#для-аппаратуры" aria-hidden="true">#</a></h2><p>Конфигуратор EdgeTX (для прошивки аппаратур на базе OpenTX): <a href="https://buddy.edgetx.org/#/flash" target="_blank" rel="noreferrer">https://buddy.edgetx.org/#/flash</a></p><h2 id="для-прошивки-видеосистем" tabindex="-1">Для прошивки видеосистем <a class="header-anchor" href="#для-прошивки-видеосистем" aria-hidden="true">#</a></h2><p>DJI Assistant 2 <strong>(DJI FPV series)</strong> (для прошивки DJI goggles v2, caddx vista, dji air unit): <a href="https://www.dji.com/global/downloads/softwares/dji-assistant-2-dji-fpv-series" target="_blank" rel="noreferrer">https://www.dji.com/global/downloads/softwares/dji-assistant-2-dji-fpv-series</a></p><p>DJI Assistant 2 <strong>(Consumer Drones Series)</strong> (для прошивки DJI goggles 2, integra, O3 air unit): <a href="https://www.dji.com/global/downloads/softwares/dji-assistant-2-consumer-drones-series" target="_blank" rel="noreferrer">https://www.dji.com/global/downloads/softwares/dji-assistant-2-consumer-drones-series</a></p><p>Прошивки для Walksnail Avatar: <a href="https://avatar-firmware.d3vl.com" target="_blank" rel="noreferrer">https://avatar-firmware.d3vl.com</a> (если недоступно, откройте через VPN или возьмите файлы <a href="https://github.com/D3VL/Avatar-Firmware-Updates" target="_blank" rel="noreferrer">тут</a>)</p><p>Прошивки для HDZero: <a href="https://www.hd-zero.com/document" target="_blank" rel="noreferrer">https://www.hd-zero.com/document</a></p><h2 id="симуляторы" tabindex="-1">Симуляторы <a class="header-anchor" href="#симуляторы" aria-hidden="true">#</a></h2><p>Симуляторы находятся на отдельной странице: <a href="https://propwashservice.ru/intro/sim.html" target="_blank" rel="noreferrer">https://propwashservice.ru/intro/sim.html</a></p><h2 id="для-изучения-логов" tabindex="-1">Для изучения логов <a class="header-anchor" href="#для-изучения-логов" aria-hidden="true">#</a></h2><p>Просмотрщик логов Betaflight Blackbox Explorer: <a href="https://github.com/betaflight/blackbox-log-viewer/releases" target="_blank" rel="noreferrer">https://github.com/betaflight/blackbox-log-viewer/releases</a></p><p>Анализатор логов PIDtoolbox: <a href="https://github.com/bw1129/PIDtoolbox/releases" target="_blank" rel="noreferrer">https://github.com/bw1129/PIDtoolbox/releases</a></p><p>Онлайн просмотрщик логов аппаратуры на базе OpenTx: <a href="https://maxbl4.github.io/otx/index.html" target="_blank" rel="noreferrer">https://maxbl4.github.io/otx/index.html</a></p><h2 id="фиксеры-драиверов-для-windows" tabindex="-1">Фиксеры драйверов для Windows <a class="header-anchor" href="#фиксеры-драиверов-для-windows" aria-hidden="true">#</a></h2><p>Ссылки на скачивание находятся на главной странице бетафлайт конфигуратора в желтой зоне, но на всякий случай продублированы здесь:</p><p>CP210x USB to UART Bridge Virtual COM Port (VCP) driver (на случай, если система не корректно распознает порт, по которому подключен полетный контроллер или аппаратура): <a href="https://www.silabs.com/developers/usb-to-uart-bridge-vcp-drivers" target="_blank" rel="noreferrer">https://www.silabs.com/developers/usb-to-uart-bridge-vcp-drivers</a></p><p>Zadig (для обновления USB драйверов, чаще всего нужен при проблемах в режиме бутлоадера(загрузчика)):<br><a href="https://zadig.akeo.ie" target="_blank" rel="noreferrer">https://zadig.akeo.ie</a></p><p>ImpulseRC driver fixer (фиксит драйвера для работы с полетным контроллером): <a href="https://impulserc.com/pages/downloads" target="_blank" rel="noreferrer">https://impulserc.com/pages/downloads</a></p><p>Также полезные драйвера можно скачать здесь: <a href="https://clck.ru/35Xp2W" target="_blank" rel="noreferrer">архивы в облаке</a>.</p><p>УСТАРЕВШЕЕ:</p><p>Конфигуратор BLHeli_S Configurator (для прошивки регуляторов, без возможности использования rpm-фильтров) (8bit): <a href="https://github.com/blheli-configurator/blheli-configurator/releases" target="_blank" rel="noreferrer">https://github.com/blheli-configurator/blheli-configurator/releases</a></p><p>Конфигуратор (jazzmaverick) BLHeli_M Configurator (для прошивки регуляторов, с возможностью использования rpm-фильтров) (8bit): <a href="https://github.com/Asizon/blheli-configurator/releases/" target="_blank" rel="noreferrer">https://github.com/Asizon/blheli-configurator/releases/</a></p>`,43),o=[l];function i(n,h,p,d,c,g){return t(),r("div",null,o)}const u=e(s,[["render",i]]);export{b as __pageData,u as default};
